  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:43.748492\",\n\t\"name\": \"some-data-on-the-polar-bear-and-its-utilization-in-the-canadian-arctic\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Some data have been collected on the polar
  bear kill and its utilization, based on information from 14 to 26 coastal settlements
  in the Canadian Arctic. Tt seems probable that a fair index of the number of bears
  taken in the region from 1921 to 1959 is represented by a graph of bear furs exported.
  More particular and exact information has been provided for the 1953-54 and1956-57
  seasons, which involves total known annual kills, total estimated actual kills,
  sex and age, chronology of kills, number of bear hunts organized, and utilization
  of the polar bear resource. Legislation and some international aspects of the polar
  bear problem have been discussed in an attempt to outline the trend of Canadian
  policy on bear legislation, while fitting the policy in this country in its proper
  international perspective.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
